import { getValue } from "@testing-library/user-event/dist/utils";
import axios from "axios";
import { useEffect, useState } from "react";
import {
  Form,
  Table,
  Button,
  FormControl,
} from "react-bootstrap";

export default function Product() {
  const [data, setData] = useState([]);
  const [name,setName] = useState('')
  const [tempValue, setTempValue] = useState('');

  const handleButtonClick = () => {
    setName(tempValue);
  };

  const params = {
    name: name,
  };
  
  const queryString = params
    ? Object.keys(params)
        .map((key) => `${encodeURIComponent(key)}=${encodeURIComponent(params[key])}`)
        .join('&')
    : '';

  const baseUrl = '/api/Domain/Product';

  const url = queryString ? `${baseUrl}/ProductList?${queryString}` : baseUrl;

  useEffect(() => {
    const fetchData = async() => {
      const response = await axios.get(url)

      setData(response.data)
    }
    fetchData()
  }, []);



  return (
    <div>
      <h1>Products:</h1>
      <Table striped bordered hover variant="dark" style={{ width: 600 }}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Count protein</th>
            <th>Count fat</th>
            <th>Count Carbohydrate</th>
          </tr>
        </thead>
        <tbody>
          {data.map((post) => {
            return (
              <tr>
                <td style={{ color: "#1e925e" }}>{post.name}</td>
                <td>{post.countProtein}</td>
                <td>{post.countFat}</td>
                <td>{post.countUgl}</td>
              </tr>
            );
          })}
        </tbody>
      </Table>
      <div style={{}}>
        <h3>Filter</h3>
        <Form.Control 
          type="name" 
          placeholder="Enter name" 
          style={{width:200}} 
          value={tempValue}
          onChange={event => setName(event.target.value)}
        />
        <Button onClick={handleButtonClick}>Find</Button>
        <p>Значение: {name}</p>
      </div>
    </div>
  );
}
